import React from "react";
import withSearch from "./WithSearch";
import { data } from "./Data";

const About = () => {
  return (
    <div>
      <div>About</div>
      <ul>
        {data.map((item, index) => (
          <li key={index}>{item}</li>
        ))}
      </ul>
    </div>
  );
};

export default withSearch(
  About,
  data.filter((item) => item.includes("About"))
);
